import React from 'react';
import '../styles/App.scss';
import {useSelector, useDispatch} from 'react-redux';

const App = () => {

  const dispatch = useDispatch();
  const state = useSelector((state) => state);
  const value = useSelector((state)=>state.inputvalue);
  console.log(state);

  return (
    <div className="App">
    <button onClick={()=>dispatch({type:'INITILIZE'})}>Initialize Game</button>
      <h1>Battleship</h1>
      <input value={value} onChange={()=> dispatch({type:'UPDATECOORDINATES',payload:value}) } />
        <button onClick={()=> dispatch({type:'FIRE',payload:value})}>Fire</button>
    </div>
  );
}

export default App;
